- input: "TEXT\x1CC00421230\x1C25077505\x1C\x1CF3XA\x1C\"This statement serves to
    document the purpose for filing an amended Form 3X, Report of Receipts and Disbursements,
    for EADS North America Americans for Competition in Aerospace PAC (FEC ID: C00421230).
    \ During the April 1- April 30, 2008 reporting period, payroll deductions in the
    amount of $979.54 were withheld from wages of employees located at a regional
    office.  The active PAC treasurer was not aware the funds had been withheld, as
    the regional office is not currently operating on a centralized payroll system
    with headquarters.  Consequently, the payroll deductions were not included in
    the originally filed Form 3X.  Upon notification of the exception, funds were
    forwarded to the PAC treasurer on June 11, 2008 and steps were immediately taken
    to file an amended Form 3X with the FEC in accordance with Advisory Opinion 1999-33.\""
